  name:{type: String},
  breweryType:{type: String},
  street:{type: String},
  city:{type: String},
  state:{type:String},
  postal:{type:String},
  longitude:{type:String},
  latitude:{type:String},
  phone:{type:String},
  url:{type:String}
})
const Brewery = mongoose.model('Brewery', brewerySchema)
module.exports = Brewery
